		//This method will calculate time difference from the current date
		public static int getUTCTimeDiffInHrs() throws ParseException{
			DateFormat utcFormat = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss.SSS");
			utcFormat.setTimeZone(TimeZone.getTimeZone("UTC"));
			
			DateFormat dateFormat = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss.SSS");
		   	Date date = new Date();
		   	Date UTCDateTime = utcFormat.parse(dateFormat.format(date)); //Getting UTC TIme for the current date
		   	
			Date localTime = new Date(); 
		   	long datediff =  localTime.getTime() - UTCDateTime.getTime(); //Finding difference between Localtime and UTC time in millisec
		   	
		   	int UTCTimeDiffInHours=(int) ((((datediff/1000)/60)/60)%24); //Converting millisecs to Hours
		   	return UTCTimeDiffInHours;
		}
		
		//This method will calculate time difference from the specified date
		public static int getUTCTimeDiffInHrs(Timestamp receivedDate) throws ParseException{
			DateFormat utcFormat = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss.SSS");
			utcFormat.setTimeZone(TimeZone.getTimeZone("UTC"));
			
			DateFormat dateFormat = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss.SSS");
		   	Date UTCDateTime = utcFormat.parse(dateFormat.format(receivedDate)); //Getting UTC TIme for the current date
		   	
		   	long datediff =  receivedDate.getTime() - UTCDateTime.getTime(); //Finding difference between Localtime and UTC time in millisec
		   	
		   	int UTCTimeDiffInHours=(int) ((((datediff/1000)/60)/60)%24); //Converting millisecs to Hours
		   	return UTCTimeDiffInHours;
		}
		
