		public static boolean isSortedInAscending(String[] data){
			boolean isAscending=false;
			if(data.length>1){
				for(int i=0;i<data.length-1;i++){
					if(data[i+1].compareTo(data[i])>=0){
						isAscending=true;
					}else{
						isAscending=false;
						break;
					}
				}
			}else if(data.length==1){
				isAscending=true;
			}
			return isAscending;
		}
		
		public static boolean isSortedInDecending(String[] data){
			boolean isDecending=false;
			if(data.length>1){
				for(int i=0;i<data.length-1;i++){
					if(data[i+1].compareTo(data[i])<=0){
						isDecending=true;
					}else{
						isDecending=false;
						break;
					}
				}
			}else if(data.length==1){
				isDecending=true;
			}
			return isDecending;
		}
		
